00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"42670","type":"Paragraph"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"42710"},"major_label_orientation":1.2,"ticker":{"id":"42228"}},"id":"42201","type":"DatetimeAxis"},{"attributes":{"text":"&lt;select onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"NERNRSCA24004.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24004&lt;/option&gt;&lt;option value=\"NERNRSCA24008.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24008&lt;/option&gt;&lt;option value=\"NERNRSCA24003.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24003&lt;/option&gt;&lt;option value=\"NERNRSCA24006.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24006&lt;/option&gt;&lt;option value=\"NERNRSCA24002.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24002&lt;/option&gt;&lt;option value=\"NERNRSCA24001.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24001&lt;/option&gt;&lt;option value=\"NERNRSCA24005.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24005&lt;/option&gt;&lt;option value=\"NERNRSCA24007.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24007&lt;/option&gt;&lt;option value=\"NERNRSOA24004.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24004&lt;/option&gt;&lt;option value=\"NERNRSOA24008.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24008&lt;/option&gt;&lt;option value=\"NERNRSOA24003.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24003&lt;/option&gt;&lt;option value=\"NERNRSOA24006.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24006&lt;/option&gt;&lt;option value=\"NERNRSOA24002.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24002&lt;/option&gt;&lt;option value=\"NERNRSOA24001.html\"&gt;Regiao de Sa\u00fade: NERNRSOA24001&lt;
